export default function Services() {
  return (
    <div className="container">
      <h2>Our Services</h2>
      <ul>
        <li>Same Day Delivery</li>
        <li>International Courier</li>
        <li>Parcel Tracking</li>
      </ul>
    </div>
  );
}
